import "./UserProfile.css";
import { Col, Row, Container } from "react-bootstrap";
import UserProfileLayout from "../components/UserProfile/UserProfileLayout";
import React from "react";
import ProfileCard from "../components/UserProfile/ProfileCard";

const UserProfile = () => {
  return (
    <React.Fragment>
    <Container>
      <Row>
        <Col style={{border:'1px solid black'}} md={8}>
          <ProfileCard />
        </Col>
        <Col style={{border:'1px solid black'}}  md={4}>
          safno fosaniofsoni fa
        </Col>
      </Row>
      <Row  style={{height:'400px'}}>
        <Col style={{border:'1px solid black'}}  md={4}>
          asdasdasd
        </Col>
        <Col style={{border:'1px solid black'}}  md={4}>
          asdasdsadsadsad
        </Col>
        <Col style={{border:'1px solid black'}}  md={4}>
          asdon saodnnosda dsaononisad
        </Col>
      </Row>
    </Container>


    <Container>
      <UserProfileLayout />
    </Container>
    </React.Fragment>
  );
};

export default UserProfile;
